#include <stdio.h>
#include <stdlib.h>

#define MAXN 200005

int n, m;
int a[MAXN], b[MAXN];
int vis[MAXN];

int dfs(int u) {
    if (u == n) return 1;
    if (vis[u]) return 0;
    vis[u] = 1;
    for (int i = 0; i < m; i++) {
        if (a[i] == u) {
            if (dfs(b[i])) return 1;
        }
    }
    return 0;
}

int main() {
    scanf("%d %d", &n, &m);
    for (int i = 0; i < m; i++) {
        scanf("%d %d", &a[i], &b[i]);
    }
    int cnt = 0;
    for (int i = 0; i < m; i++) {
        if (a[i] == 1) {
            cnt++;
            if (dfs(b[i])) {
                printf("POSSIBLE\n");
                return 0;
            }
        }
    }
    if (cnt > 1) {
        printf("POSSIBLE\n");
    } else {
        printf("IMPOSSIBLE\n");
    }
    return 0;
}
